title: 'Lino Kirin'
date: '2025-06-03'
excerpt: "This project brought together my love for mythical creatures with my recent journey into printmaking..."
thumbnail: "/Lyssis-Designs/Images/PrintMaking/BlueBeigeKirin.jpg"
thumbnailPosition: "right"
